(294,1712848600,2,'BE',1,0,1,'tx_success_faq','{\"oldRecord\":{\"question\":\"First Question\",\"answer\":\"Here is an answer\",\"l10n_diffsource\":null},\"newRecord\":{\"question\":\"How long will it take for my customized surfboard to be ready?\",\"answer\":\"<p>The production time for customized surfboards is usually around 4-6 weeks, depending on the complexity of the design and the current order situation.<br \\/>&nbsp;<\\/p>\",\"l10n_diffsource\":\"{\\\"question\\\":\\\"\\\",\\\"answer\\\":\\\"\\\",\\\"hidden\\\":\\\"\\\"}\"}}',0,'0400$c0dc187d7eae3a2daead33cfff3d9e35:f2444a01b0daf45b26a8a5044a8a5d4a'),
(295,1712848600,2,'BE',1,0,2,'tx_success_faq','{\"oldRecord\":{\"question\":\"Second Question\",\"answer\":\"Here is a longer answer\",\"l10n_diffsource\":null},\"newRecord\":{\"question\":\"Can I use my own image for the surfboard?\",\"answer\":\"<p>Yes, we accept customized images for the design of your surfboards. Please make sure that the image has sufficient resolution to ensure high quality printing. If the quality is not good enough we\'ll get back to you about that topic.<\\/p>\",\"l10n_diffsource\":\"{\\\"question\\\":\\\"\\\",\\\"answer\\\":\\\"\\\",\\\"hidden\\\":\\\"\\\"}\"}}',0,'0400$c0dc187d7eae3a2daead33cfff3d9e35:cdda8437828faa1df331c6dbdaf18a3d'),
(296,1712848600,1,'BE',1,0,9,'tx_success_faq','{\"l10n_parent\":0,\"l10n_diffsource\":\"\",\"starttime\":0,\"endtime\":0,\"t3_origuid\":0,\"l10n_source\":0,\"pid\":1,\"sorting\":0,\"question\":\"Are the surfboards suitable for all levels of experience?\",\"answer\":\"<p>Yes, we offer customized surfboards for beginners through to advanced surfers, depending your personal board. We don\'t sell the boards itself, we just offer the customization of your private board. If required, we will be happy to advise you on choosing the right board for your skills and preferences.<\\/p>\",\"sys_language_uid\":0,\"crdate\":1712848600,\"t3ver_stage\":0,\"tstamp\":1712848600,\"uid\":9}',0,'0400$c0dc187d7eae3a2daead33cfff3d9e35:c43c8f61c28084b345d54a05f3adab8f'),
(297,1712848600,1,'BE',1,0,10,'tx_success_faq','{\"l10n_parent\":0,\"l10n_diffsource\":\"\",\"starttime\":0,\"endtime\":0,\"t3_origuid\":0,\"l10n_source\":0,\"pid\":1,\"sorting\":256,\"question\":\"Can I personalize my surfboard by adding my name or a message?\",\"answer\":\"<p>Yes, we offer the option to add your name or a short message on your surfboard. Please specify these requirements when ordering on the comments section. For the offer we will send you a design example.<\\/p>\",\"sys_language_uid\":0,\"crdate\":1712848600,\"t3ver_stage\":0,\"tstamp\":1712848600,\"uid\":10}',0,'0400$c0dc187d7eae3a2daead33cfff3d9e35:3ef5f8a13e5628a7527a354776e006f9'),
