(311,1712849115,2,'BE',1,0,8,'tt_content','{\"oldRecord\":{\"bodytext\":\"<p><span style=\\\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);color:rgb(13, 13, 13);display:inline !important;float:none;font-family:S\\u00f6hne, ui-sans-serif, system-ui, -apple-system, &quot;Segoe UI&quot;, Roboto, Ubuntu, Cantarell, &quot;Noto Sans&quot;, sans-serif, &quot;Helvetica Neue&quot;, Arial, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:pre-wrap;widows:2;word-spacing:0px;\\\">Customize your surfboard with a <strong>unique image that reflects your personality<\\/strong>. Whether it\'s a breathtaking sunset, a favorite landscape, or an artistic creation, make your board one-of-a-kind and truly yours.<\\/span><\\/p>\"},\"newRecord\":{\"bodytext\":\"<p>Customize your surfboard with a unique <strong>image that reflects your personality<\\/strong>. Whether it\'s a breathtaking sunset, a favorite landscape, or an artistic creation, make your board one-of-a-kind and truly yours.<\\/p>\"}}',0,'0400$54baf60b4037ac19518a944e352db82a:2097d84972a039cb6bfe093b17089287'),
