(314,1712849264,1,'BE',1,0,35,'tt_content','{\"CType\":\"textmedia\",\"starttime\":0,\"endtime\":0,\"sys_language_uid\":0,\"categories\":\"0\",\"l18n_parent\":0,\"layout\":\"0\",\"frame_class\":\"default\",\"space_before_class\":\"medium\",\"space_after_class\":\"medium\",\"bullets_type\":\"0\",\"colPos\":\"0\",\"date\":0,\"header_layout\":\"0\",\"header_position\":\"\",\"imagewidth\":0,\"imageheight\":0,\"imageorient\":\"0\",\"imagecols\":\"2\",\"cols\":\"0\",\"recursive\":\"0\",\"list_type\":\"\",\"target\":\"\",\"sectionIndex\":1,\"accessibility_title\":\"\",\"accessibility_bypass_text\":\"\",\"l18n_diffsource\":\"\",\"table_class\":\"\",\"table_delimiter\":\"124\",\"table_enclosure\":\"0\",\"table_header_position\":\"0\",\"table_tfoot\":0,\"uploads_description\":0,\"uploads_type\":\"0\",\"header_style\":\"default\",\"button_style\":\"primary\",\"pid\":1,\"sorting\":1920,\"overline\":\"\",\"header\":\"Our Quality Guarantee\",\"subheader\":\"\",\"bodytext\":\"<p>At Surfcompany Ltd., we are committed to excellence. We utilize only premium materials and state-of-the-art printing techniques to ensure that your custom surfboard not only looks stunning but also delivers exceptional performance in the waves. Your satisfaction and enjoyment are our top priorities.<\\/p>\",\"button_link\":\"\",\"button_label\":\"\",\"hidden\":\"0\",\"fe_group\":\"\",\"editlock\":\"0\",\"rowDescription\":\"\",\"crdate\":1712849264,\"t3ver_stage\":0,\"tstamp\":1712849264,\"uid\":35}',0,'0400$c6015c923cd2cfe84b2bd34bf28e6727:d31fbabb978b029b9ff62ab107e0a25e'),
