(316,1712849380,1,'BE',1,0,36,'tt_content','{\"CType\":\"textmedia\",\"starttime\":0,\"endtime\":0,\"sys_language_uid\":0,\"categories\":\"0\",\"l18n_parent\":0,\"layout\":\"0\",\"frame_class\":\"default\",\"space_before_class\":\"medium\",\"space_after_class\":\"medium\",\"bullets_type\":\"0\",\"colPos\":\"0\",\"date\":0,\"header_layout\":\"0\",\"header_position\":\"\",\"imagewidth\":0,\"imageheight\":0,\"imageorient\":\"0\",\"imagecols\":\"2\",\"cols\":\"0\",\"recursive\":\"0\",\"list_type\":\"\",\"target\":\"\",\"sectionIndex\":1,\"accessibility_title\":\"\",\"accessibility_bypass_text\":\"\",\"l18n_diffsource\":\"\",\"table_class\":\"\",\"table_delimiter\":\"124\",\"table_enclosure\":\"0\",\"table_header_position\":\"0\",\"table_tfoot\":0,\"uploads_description\":0,\"uploads_type\":\"0\",\"header_style\":\"default\",\"button_style\":\"primary\",\"pid\":1,\"sorting\":1984,\"overline\":\"\",\"header\":\"The Art of Surfboard Design\",\"subheader\":\"\",\"bodytext\":\"<p>Explore the intricate process involved in creating your ideal surfboard. Beginning with the careful selection of the perfect image, our skilled artisans meticulously guide your chosen design onto the surface of your board. With each stroke and detail, they infuse their passion and expertise, ensuring that every aspect of your board reflects precision craftsmanship. The end result is not just a surfboard but a true masterpiece, tailored to embody your distinct style and vision, ready to accompany you on countless adventures in the waves.<\\/p>\",\"button_link\":\"\",\"button_label\":\"\",\"hidden\":\"0\",\"fe_group\":\"\",\"editlock\":\"0\",\"rowDescription\":\"\",\"crdate\":1712849380,\"t3ver_stage\":0,\"tstamp\":1712849380,\"uid\":36}',0,'0400$9bdd5f2d673afe1d0183fbfca3915776:6fdd460ee24b22c6f60683a1eee4989a'),
