(667,1712934563,2,'BE',1,0,48,'tt_content','{\"oldRecord\":{\"bodytext\":\"<p>TYPO3 is a versatile open-source content management system renowned for its flexibility and scalability. Offering a wide range of extensions and plugins, it empowers users to create highly customizable websites and applications. With its stable and secure foundation, intuitive interface, and powerful backend architecture, TYPO3 is the top choice for enterprise-level projects and mission-critical websites, enabling effortless content creation and management across multiple channels. Whether you\'re a developer craving customization or a business owner seeking reliability, TYPO3 is your gateway to digital excellence.<\\/p>\\r\\n<p>Find out more<\\/p>\",\"l18n_diffsource\":\"{\\\"CType\\\":\\\"\\\",\\\"colPos\\\":\\\"\\\",\\\"overline\\\":\\\"\\\",\\\"header\\\":\\\"\\\",\\\"header_layout\\\":\\\"\\\",\\\"header_style\\\":\\\"\\\",\\\"subheader\\\":\\\"\\\",\\\"bodytext\\\":\\\"\\\",\\\"layout\\\":\\\"\\\",\\\"space_before_class\\\":\\\"\\\",\\\"space_after_class\\\":\\\"\\\",\\\"sectionIndex\\\":\\\"\\\",\\\"linkToTop\\\":\\\"\\\",\\\"sys_language_uid\\\":\\\"\\\",\\\"hidden\\\":\\\"\\\",\\\"starttime\\\":\\\"\\\",\\\"endtime\\\":\\\"\\\",\\\"fe_group\\\":\\\"\\\",\\\"editlock\\\":\\\"\\\",\\\"categories\\\":\\\"\\\",\\\"rowDescription\\\":\\\"\\\"}\"},\"newRecord\":{\"bodytext\":\"<p>TYPO3 is a versatile open-source content management system renowned for its flexibility and scalability. Offering a wide range of extensions and plugins, it empowers users to create highly customizable websites and applications. With its stable and secure foundation, intuitive interface, and powerful backend architecture, TYPO3 is the top choice for enterprise-level projects and mission-critical websites, enabling effortless content creation and management across multiple channels. Whether you\'re a developer craving customization or a business owner seeking reliability, TYPO3 is your gateway to digital excelle