(691,1712936361,1,'BE',1,0,55,'tt_content','{\"CType\":\"textmedia\",\"starttime\":0,\"endtime\":0,\"sys_language_uid\":0,\"categories\":\"0\",\"l18n_parent\":0,\"layout\":\"0\",\"frame_class\":\"default\",\"space_before_class\":\"medium\",\"space_after_class\":\"medium\",\"bullets_type\":\"0\",\"colPos\":\"0\",\"date\":0,\"header_layout\":\"0\",\"header_position\":\"\",\"imagewidth\":0,\"imageheight\":0,\"imageorient\":\"1\",\"imagecols\":\"2\",\"cols\":\"0\",\"recursive\":\"0\",\"list_type\":\"\",\"target\":\"\",\"sectionIndex\":1,\"accessibility_title\":\"\",\"accessibility_bypass_text\":\"\",\"l18n_diffsource\":\"\",\"table_class\":\"\",\"table_delimiter\":\"124\",\"table_enclosure\":\"0\",\"table_header_position\":\"0\",\"table_tfoot\":0,\"uploads_description\":0,\"uploads_type\":\"0\",\"header_style\":\"default\",\"button_style\":\"primary\",\"pid\":4,\"sorting\":1536,\"overline\":\"\",\"header\":\"\",\"subheader\":\"About Fuerteventura and La Pared:\",\"bodytext\":\"<p>Fuerteventura, known for its breathtaking beaches and year-round sunshine, is a paradise for those seeking relaxation and adventure alike. La Pared, a charming village on the southwest coast of the island, is where Hotel La Pared Playitas resides. Nestled between the majestic mountains and the azure Atlantic Ocean, La Pared offers a tranquil escape from the hustle and bustle of everyday life. With its laid-back atmosphere and stunning natural beauty, it\'s the perfect setting for our pool bar, where guests can unwind and soak in the island vibes.<\\/p>\",\"button_link\":\"\",\"button_label\":\"\",\"hidden\":\"0\",\"fe_group\":\"\",\"editlock\":\"0\",\"rowDescription\":\"\",\"crdate\":1712936361,\"t3ver_stage\":0,\"tstamp\":1712936361,\"uid\":55}',0,'0400$d12acf8f1e0ba39699937419dd0a1754:446729e5b5ab26ef6a2707cb143bcbae'),
