(694,1712936510,1,'BE',1,0,12,'tx_success_faq','{\"l10n_parent\":0,\"l10n_diffsource\":\"\",\"starttime\":0,\"endtime\":0,\"t3_origuid\":0,\"l10n_source\":0,\"pid\":4,\"sorting\":256,\"question\":\"What qualifications do I need to apply for the pool bar tender position?\",\"answer\":\"<p>While previous experience in bartending is preferred, we value enthusiasm and a willingness to learn. Training will be provided for the right candidate.<\\/p>\",\"sys_language_uid\":0,\"crdate\":1712936510,\"t3ver_stage\":0,\"tstamp\":1712936510,\"uid\":12}',0,'0400$53c6e4fa1963ae9f4c67d00230f6afc4:4723f7f1edc0f7b82e78a2785de9828b'),
(695,1712936510,1,'BE',1,0,13,'tx_success_faq','{\"l10n_parent\":0,\"l10n_diffsource\":\"\",\"starttime\":0,\"endtime\":0,\"t3_origuid\":0,\"l10n_source\":0,\"pid\":4,\"sorting\":128,\"question\":\"What are the typical responsibilities of a pool bar tender at Hotel La Pared Playitas?\",\"answer\":\"<p>As a pool bar tender, your main responsibilities will include preparing and serving drinks, maintaining cleanliness and hygiene standards, providing excellent customer service, and ensuring guest satisfaction.<\\/p>\",\"sys_language_uid\":0,\"crdate\":1712936510,\"t3ver_stage\":0,\"tstamp\":1712936510,\"uid\":13}',0,'0400$53c6e4fa1963ae9f4c67d00230f6afc4:ed3dafc4b580223b8de0a83e1a56b3f4'),
(696,1712936510,1,'BE',1,0,14,'tx_success_faq','{\"l10n_parent\":0,\"l10n_diffsource\":\"\",\"starttime\":0,\"endtime\":0,\"t3_origuid\":0,\"l10n_source\":0,\"pid\":4,\"sorting\":64,\"question\":\"What is the work environment like at Hotel La Pared Playitas?\",\"answer\":\"<p>Our work environment is friendly, supportive, and team-oriented. We prioritize teamwork, communication, and a positive attitude to create an enjoyable experience for both our guests and our staff.<\\/p>\",\"sys_language_uid\":0,\"crdate\":1712936510,\"t3ver_stage\":0,\"tstamp\":1712936510,\"uid\":14}',0,'0400$53c6e4fa1963ae9f4c67d00230f6afc4:c5ef80b3a3d5047ff3b3cd7acdb58469'),
(697,1712936510,1,'BE',1,0,15,'tx_success_faq','{\"l10n_parent\":0,\"l10n_diffsource\":\"\",\"starttime\":0,\"endtime\":0,\"t3_origuid\":0,\"l10n_source\":0,\"pid\":4,\"sorting\":32,\"question\":\"Are there opportunities for advancement within the hotel?\",\"answer\":\"<p>Yes, we believe in promoting from within whenever possible. As you gain experience and demonstrate your skills and dedication, there are opportunities for career growth and advancement within our organization.<\\/p>\",\"sys_language_uid\":0,\"crdate\":1712936510,\"t3ver_stage\":0,\"tstamp\":1712936510,\"uid\":15}',0,'0400$53c6e4fa1963ae9f4c67d00230f6afc4:ee3e3dd78d2a3eb083f58a0aa2fd7b58'),
(698,1712936510,1,'BE',1,0,16,'tx_success_faq','{\"l10n_parent\":0,\"l10n_diffsource\":\"\",\"starttime\":0,\"endtime\":0,\"t3_origuid\":0,\"l10n_source\":0,\"pid\":4,\"sorting\":16,\"question\":\"What is the dress code for pool bar staff?\",\"answer\":\"<p>Our pool bar staff are required to maintain a neat and professional appearance. We provide uniforms for all employees to ensure a consistent and polished look while on duty.<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\",\"sys_language_uid\":0,\"crdate\":1712936510,\"t3ver_stage\":0,\"tstamp\":1712936510,\"uid\":16}',0,'0400$53c6e4fa1963ae9f4c67d00230f6afc4:daa649cca0a07e40145116758957b0fc'),
