(1,1,1735896733,1712918463,0,1,0,0,0,0,'Personalize Your Ride',NULL,1,4,'tt_content','<p>Choose from a range of customization options to make your surfboard truly yours. From selecting your favorite image to adding personalized text or graphics, unleash your creativity and design a board that reflects your unique style and personality.</p>',0,0,0,0,0,0,NULL,0,'{\"hidden\":\"\"}','t3://record?identifier=contentInModal&uid=12','FAQ','primary'),
(2,1,1735896733,1712918801,0,2,0,0,0,0,'Crafted with Care',NULL,1,4,'tt_content','<p>Our experienced artisans meticulously handcraft each surfboard using premium materials and cutting-edge techniques. With attention to detail at every step of the process, we ensure that your board not only looks stunning but also delivers exceptional performance in the water.</p>',0,0,0,0,0,0,NULL,0,'{\"headline\":\"\",\"media\":\"\",\"bodytext\":\"\",\"button_link\":\"\",\"button_label\":\"\",\"button_style\":\"\",\"sys_language_uid\":\"\",\"hidden\":\"\",\"starttime\":\"\",\"endtime\":\"\"}','','','primary'),
(3,1,1735896733,1712919175,0,3,0,0,0,0,'Your Satisfaction, Our Priority',NULL,1,4,'tt_content','<p>At Surfcompany Ltd., customer satisfaction is at the heart of everything we do. We strive to exceed your expectations by providing personalized service, prompt communication, and a hassle-free experience from design to delivery. Your happiness with your custom surfboard is our ultimate goal.</p>',0,0,0,0,0,0,NULL,0,'{\"hidden\":\"\"}','','','primary'),
(4,5,1712942570,1712922985,0,1,0,0,0,0,'Product Launch',NULL,1,42,'tt_content','<p>Maximize your product\'s potential with our dynamic landing page solution, offering seamless customization and captivating design to drive engagement, conversions, and brand success.</p>',0,0,0,0,0,0,NULL,0,'{\"hidden\":\"\"}','t3://page?uid=1 _blank','Explore the set','secondary'),
(5,5,1712942570,1712923193,0,2,0,0,0,0,'Whitepaper',NULL,1,42,'tt_content','<p>Unlock the power of your research and insights with our whitepaper landing page solution, empowering you to showcase your expertise with polished design and seamless customization, driving engagement and establishing authority in your field.</p>',0,0,0,0,0,0,NULL,0,'{\"hidden\":\"\"}','t3://page?uid=2 _blank','Explore the set','secondary'),
(6,5,1712942570,1712934282,0,4,0,0,0,0,'Want some more?',NULL,1,42,'tt_content','<p>Donate some money, so we can fly to Fuerteventura again soon!</p>',0,0,0,0,0,0,NULL,0,'{\"headline\":\"\",\"media\":\"\",\"bodytext\":\"\",\"button_link\":\"\",\"button_label\":\"\",\"button_style\":\"\",\"sys_language_uid\":\"\",\"hidden\":\"\",\"starttime\":\"\",\"endtime\":\"\"}','t3://page?uid=5','Donate now','primary'),
(7,4,1712939711,1712939403,0,1,0,0,0,0,'Orangeberry madness',NULL,1,66,'tt_content','<ul><li>2 oz. vodka</li><li>1 oz. orange liqueur (such as Cointreau)</li><li>1 oz. freshly squeezed orange juice</li><li>1/2 oz. freshly squeezed lemon juice</li><li>1/2 oz. simple syrup</li><li>Handful of mixed berries (strawberries, raspberries, blueberries)</li><li>Ice cubes</li><li>Orange slice and berry skewer for garnish</li></ul>',0,0,0,0,0,0,NULL,0,'{\"hidden\":\"\"}','','','primary'),
(8,4,1712939711,1712939403,0,2,0,0,0,0,'Smashed by Hulk',NULL,1,66,'tt_content','<ul><li>2 oz. white rum</li><li>1 oz. blue curaçao</li><li>1 oz. freshly squeezed lime juice</li><li>1/2 oz. simple syrup</li><li>Handful of fresh mint leaves</li><li>Club soda</li><li>Lime wedge and mint sprig for garnish</li><li>Ice cubes</li></ul>',0,0,0,0,0,0,NULL,0,'{\"headline\":\"\",\"media\":\"\",\"bodytext\":\"\",\"button_link\":\"\",\"button_label\":\"\",\"button_style\":\"\",\"sys_language_uid\":\"\",\"hidden\":\"\",\"starttime\":\"\",\"endtime\":\"\"}','','','primary'),
(9,4,1712939711,1712939403,0,3,0,0,0,0,'Giant sinker',NULL,1,66,'tt_content','<ul><li>2 oz. gin</li><li>1 oz. blue curaçao</li><li>1/2 oz. freshly squeezed lemon juice</li><li>1/2 oz. simple syrup</li><li>1/2 oz. coconut cream</li><li>Splash of soda water</li><li>Ice cubes</li><li>Lemon twist for garnish</li></ul>',0,0,0,0,0,0,NULL,0,'{\"headline\":\"\",\"media\":\"\",\"bodytext\":\"\",\"button_link\":\"\",\"button_label\":\"\",\"button_style\":\"\",\"sys_language_uid\":\"\",\"hidden\":\"\",\"starttime\":\"\",\"endtime\":\"\"}','','','primary'),
(10,5,1712942570,1712940230,0,3,0,0,0,0,'Career',NULL,1,42,'tt_content','<p>Visit our vibrant Career Landing Page, where opportunities shine in every hue. Explore a world of colorful careers that celebrate diversity and creativity. Join us and paint your professional journey with bold strokes of innovation.</p>',0,0,0,0,0,0,NULL,0,'{\"hidden\":\"\"}','t3://page?uid=4 _blank','Explore the set','secondary');
INSERT INTO `tx_success_faq` VALUES
(1,1,1712917833,1712764600,0,1,0,0,0,0,'How long will it take for my customized surfboard to be ready?','<p>The production time for customized surfboards is usually around 4-6 weeks, depending on the complexity of the design and the current order situation.<br />&nbsp;</p>',12,'tt_content',0,0,0,0,0,0,NULL,0,'{\"hidden\":\"\"}'),
(2,1,1712917833,1712764600,0,2,0,0,0,0,'Can I use my own image for the surfboard?','<p>Yes, we accept customized images for the design of your surfboards. Please make sure that the image has sufficient resolution to ensure high quality printing. If the quality is not good enough we\'ll get back to you about that topic.</p>',12,'tt_content',0,0,0,0,0,0,NULL,0,'{\"hidden\":\"\"}'),
(3,6,1735894126,1712765065,1,1,0,0,0,0,'Which team is the best?','success',15,'tt_content',0,0,0,0,0,0,NULL,0,NULL),
(4,6,1735894126,1712765065,1,2,0,0,0,0,'What is TYPO3?','TYPO3 CMS ist ein freies Content-Management-System für Websites, das seit Oktober 2012 offiziell unter dem Namen TYPO3 CMS angeboten wird. Ursprünglich wurde TYPO3 von Kasper Skårhøj entwickelt.',15,'tt_content',0,0,0,0,0,0,NULL,0,NULL),
(5,6,1735894126,1712765120,1,3,0,0,0,0,'Do you know TYPO3 Sets?','Sets are the new hot shit in TYPO3!!!',15,'tt_content',0,0,0,0,0,0,NULL,0,NULL),
(6,8,1735894135,1712826299,1,1,0,0,0,0,'Which team is the best?','success',27,'tt_content',0,0,0,0,0,0,NULL,0,NULL),
(7,8,1735894135,1712826299,1,2,0,0,0,0,'What is TYPO3?','TYPO3 CMS ist ein freies Content-Management-System für Websites, das seit Oktober 2012 offiziell unter dem Namen TYPO3 CMS angeboten wird. Ursprünglich wurde TYPO3 von Kasper Skårhøj entwickelt.',27,'tt_content',0,0,0,0,0,0,NULL,0,NULL),
(8,8,1735894135,1712826299,1,3,0,0,0,0,'Do you know TYPO3 Sets?','Sets are the new hot shit in TYPO3!!!',27,'tt_content',0,0,0,0,0,0,NULL,0,NULL),
(9,1,1712917833,1712848600,0,3,0,0,0,0,'Are the surfboards suitable for all levels of experience?','<p>Yes, we offer customized surfboards for beginners through to advanced surfers, depending your personal board. We don\'t sell the boards itself, we just offer the customization of your private board. If required, we will be happy to advise you on choosing the right board for your skills and preferences.</p>',12,'tt_content',0,0,0,0,0,0,NULL,0,'{\"hidden\":\"\"}'),
(10,1,1712917833,1712848600,0,4,0,0,0,0,'Can I personalize my surfboard by adding my name or a message?','<p>Yes, we offer the option to add your name or a short message on your surfboard. Please specify these requirements when ordering on the comments section. For the offer we will send you a design example.</p>',12,'tt_content',0,0,0,0,0,0,NULL,0,'{\"hidden\":\"\"}'),
(11,1,1712917833,1712848600,0,5,0,0,0,0,'Do you offer worldwide shipping?','<p>Yes, we ship our surfboards worldwide. Shipping costs vary depending on the destination and size of the surfboard. Please contact us for more detailed information on shipping costs to your country.</p>',12,'tt_content',0,0,0,0,0,0,NULL,0,'{\"hidden\":\"\"}'),
(12,4,1712938380,1712936510,0,1,0,0,0,0,'What qualifications do I need to apply for the pool bar tender position?','<p>While previous experience in bartending is preferred, we value enthusiasm and a willingness to learn. Training will be provided for the right candidate.</p>',56,'tt_content',0,0,0,0,0,0,NULL,0,'{\"hidden\":\"\"}'),
(13,4,1712938380,1712936510,0,2,0,0,0,0,'What are the typical responsibilities of a pool bar tender at Hotel La Pared Playitas?','<p>As a pool bar tender, your main responsibilities will include preparing and serving drinks, maintaining cleanliness and hygiene standards, providing excellent customer service, and ensuring guest satisfaction.</p>',56,'tt_content',0,0,0,0,0,0,NULL,0,'{\"hidden\":\"\"}'),
(14,4,1712938380,1712936510,0,3,0,0,0,0,'What is the work environment like at Hotel La Pared Playitas?','<p>Our work environment is friendly, supportive, and team-oriented. We prioritize teamwork, communication, and a positive attitude to create an enjoyable experience for both our guests and our staff.</p>',56,'tt_content',0,0,0,0,0,0,NULL,0,'{\"hidden\":\"\"}'),
(15,4,1712938380,1712936510,0,4,0,0,0,0,'Are there opportunities for advancement within the hotel?','<p>Yes, we believe in promoting from within whenever possible. As you gain experience and demonstrate your skills and dedication, there are opportunities for career growth and advancement within our organization.</p>',56,'tt_content',0,0,0,0,0,0,NULL,0,'{\"hidden\":\"\"}'),
(16,4,1712938380,1712936510,0,5,0,0,0,0,'What is the dress code for pool bar staff?','<p>Our pool bar staff are required to maintain a neat and professional appearance. We provide uniforms for all employees to ensure a consistent and polished look while on duty.</p>\r\n\r\n\r\n\r\n\r\n',56,'tt_content',0,0,0,0,0,0,NULL,0,'{\"hidden\":\"\"}');
