INSERT INTO `tx_success_review` VALUES
(4,6,1735894126,1712765207,1,1,0,0,0,0,'Foo Bar','<p>Lorem ipsum dolor si<strong>t amet, consectetuer adipiscing elit. A</strong>enean commodo ligula eget dolor. Aenean massa. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Donec quam felis, ultricies nec, pellentesque eu, pretium quis, sem. Nulla consequat massa quis enim.</p>',17,'tt_content',0,0,0,0,0,0,NULL,0,NULL),
(5,6,1735894126,1712767240,1,2,0,0,0,0,'Trapattoni \'98','<p>Es gibt keine deutsche Mannschaft spielt offensiv und die Name offensiv wie Bayern. Letzte Spiel hatten wir in Platz drei Spitzen: Elber, Jancka und dann Zickler. Wir müssen nicht vergessen Zickler. Zickler ist eine Spitzen mehr, Mehmet eh mehr Basler.</p>',17,'tt_content',0,0,0,0,0,0,NULL,0,NULL),
(6,8,1735894135,1712826299,1,1,0,0,0,0,'Foo Bar','<p>Lorem ipsum dolor si<strong>t amet, consectetuer adipiscing elit. A</strong>enean commodo ligula eget dolor. Aenean massa. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Donec quam felis, ultricies nec, pellentesque eu, pretium quis, sem. Nulla consequat massa quis enim.</p>',26,'tt_content',0,0,0,0,0,0,NULL,0,'{\"hidden\":\"\"}'),
(7,8,1735894135,1712826299,1,2,0,0,0,0,'Trapattoni \'98','<p>Es gibt keine deutsche Mannschaft spielt offensiv und die Name offensiv wie Bayern. Letzte Spiel hatten wir in Platz drei Spitzen: Elber, Jancka und dann Zickler. Wir müssen nicht vergessen Zickler. Zickler ist eine Spitzen mehr, Mehmet eh mehr Basler.</p>',26,'tt_content',0,0,0,0,0,0,NULL,0,'{\"hidden\":\"\"}'),
(8,8,1735894135,1712845220,1,3,0,0,0,0,'Foo','<p>Bar</p>\r\n<p>Baz</p>',26,'tt_content',0,0,0,0,0,0,NULL,0,''),
(9,1,1712919711,1712845807,0,1,0,0,0,0,'Andras O.','<p>I was impressed by the fast processing and the friendly customer service. My surfboard is one of a kind and I can\'t wait to <strong>conquer the waves</strong> with it!</p>',7,'tt_content',0,0,0,0,0,0,NULL,0,'{\"name\":\"\",\"review\":\"\",\"hidden\":\"\"}'),
(10,1,1712919711,1712846532,0,2,0,0,0,0,'Julia G.','<p>My customized surfboard is an absolute <strong>eye-catcher</strong>! The quality is outstanding and the design is exactly how I imagined it.</p>',7,'tt_content',0,0,0,0,0,0,NULL,0,'{\"hidden\":\"\"}'),
(11,1,1712919711,1712846576,0,3,0,0,0,0,'André B.','<p>Being able to have my own image on my surfboard has taken the fun of surfing to a whole <strong>new level</strong>. An absolute must-have for every surfer!</p>',7,'tt_content',0,0,0,0,0,0,NULL,0,'{\"hidden\":\"\"}'),
(12,1,1712919711,1712846592,0,5,0,0,0,0,'Arber S.','<p>I love my personalized surfboard! It\'s not only a <strong>great piece</strong> of surfing equipment, but also a work of art that perfectly embodies my passion for surfing.</p>',7,'tt_content',0,0,0,0,0,0,NULL,0,'{\"hidden\":\"\"}'),
(13,1,1712919711,1712846844,0,4,0,0,0,0,'Nadja N.','<p>The surfboard I received from <strong>exceeded my expectations</strong>. The colors are vibrant and the details are incredibly precise.</p>',7,'tt_content',0,0,0,0,0,0,NULL,0,'{\"hidden\":\"\"}'),
(14,1,1712919711,1712847009,0,6,0,0,0,0,'Rafal P.','<p>The process of designing my surfboard was <strong>simple and straightforward</strong>. The result is a unique surfboard that will earn me many envious looks on the beach!</p>',7,'tt_content',0,0,0,0,0,0,NULL,0,'{\"hidden\":\"\"}'),
(15,2,1712944121,1712930392,0,1,0,0,0,0,'Sarah T., TYPO3 Website Owner','<p>Thanks to this white paper, migrating from WordPress to TYPO3 was a breeze! TYPO3\'s flexibility has transformed our website, driving more traffic and engagement than ever before. Highly recommend for those ready to elevate their online presence!\"</p>',46,'tt_content',0,0,0,0,0,0,NULL,0,'{\"hidden\":\"\"}');
